import React from 'react';
import { Avatar } from 'material-ui/core';

function Story_blok(props) {
  return (
    <div>
      <Avatar src={props.proPic} />
      <div>{props.story}</div>
      <h4>{props.name}</h4>
    </div>
  );
}

export default Story_blok;
